import React from 'react'
import NavBar from '../functional/NavBar'
import { BrowserRouter, Route } from 'react-router-dom'

const LandingPage = () => {
    return (
        <BrowserRouter>
            <div className="container">
                <NavBar />

                <Route path='/' component={LandingPage} />
            </div>
        </BrowserRouter>
    )
}

export default LandingPage;
